<script lang="ts">
    import { fly } from 'svelte/transition';

    const width = 1200;
    const height = 390;

    type Pin = {
        lat: number;
        lng: number;
        city: string;
        code: string;
        available?: boolean;
        release?: string;
    };

    type TooltipData = Omit<Pin, 'lat' | 'lng'> & { x: number; y: number };

    const getPins = (locations: Array<Pin>) => {
        const mapWidth = 1000;
        const mapHeight = 300;
        const mapLeft = 0;
        const mapTop = 45;

        return locations.map(({ lat, lng, ...pin }, index) => {
            const x = (lng + 140) / 300;

            const y = (90 - lat) / 180;
            const adjustedY = y * 0.95;

            const cx = mapLeft + x * mapWidth;
            const cy = mapTop + adjustedY * mapHeight;

            const offsets = [
                { index: 0, cxOffset: 40, cyOffset: -10 }, // Frankfurt
                { index: 1, cxOffset: 0, cyOffset: 0 }, // NYC
                { index: 2, cxOffset: 170, cyOffset: 80 }, // Sydney
                { index: 3, cxOffset: 5, cyOffset: 0 }, // SF
                { index: 4, cxOffset: 15, cyOffset: -15 }, // Amsterdam
                { index: 5, cxOffset: 48, cyOffset: 20 }, // Bangalore
                { index: 6, cxOffset: 82, cyOffset: 45 } // Singapore
            ];

            const { cxOffset, cyOffset } = offsets[index] || { cxOffset: 0, cyOffset: 0 };

            return { cx: cx + cxOffset, cy: cy + cyOffset, ...pin };
        });
    };

    const pins = getPins([
        {
            lat: 50.1109,
            lng: 8.6821,
            city: 'Frankfurt',
            code: 'GER',
            available: true
        },
        {
            lat: 40.7128,
            lng: -74.006,
            city: 'New York City',
            code: 'NYC',
            available: false
        },
        {
            lat: -33.8688,
            lng: 151.2093,
            city: 'Syndey',
            code: 'AUS',
            available: false
        },
        {
            lat: 37.7749,
            lng: -122.4194,
            city: 'San Francisco',
            code: 'SFO',
            available: false
        },
        {
            lat: 52.3676,
            lng: 4.9041,
            city: 'Amsterdam',
            code: 'AMS',
            available: false
        },
        {
            lat: 12.9716,
            lng: 77.5946,
            city: 'Bangalore',
            code: 'IND',
            available: false
        },
        {
            lat: 1.3521,
            lng: 103.8198,
            city: 'Signapore',
            code: 'SGP',
            available: false
        }
    ]);

    let tooltip: TooltipData = {
        x: 0,
        y: 0,
        city: '',
        code: '',
        release: '',
        available: undefined
    };

    let showTooltip: boolean = false;
    let tooltipElement: HTMLElement;
    let mapContainer: HTMLElement;

    const handleTooltip = ({
        event,
        ...pin
    }: {
        event: MouseEvent;
    } & Omit<TooltipData, 'x' | 'y'>) => {
        const mapRect = mapContainer.getBoundingClientRect();
        const mouseX = event.clientX - mapRect.left;
        const mouseY = event.clientY - mapRect.top;

        showTooltip = true;
        tooltip = {
            x: mouseX,
            y: mouseY,
            city: pin.city,
            code: pin.code,
            available: pin.available,
            release: pin.release
        };
    };
</script>

